GTK-IIIh/HSP<br>
入り数：1枚<br>
サイズ：35mm×40mm<br>
耐熱温度：最大150℃まで<br>
適応種別：ガソリン車/ディーゼル車/バイク/船/ジェットなど<br>
使用用途：エンジンヘッド/クリーナーボックス/エアーパイピング/インテークマニホールド/ATオイルパン/ラジエーターホース/バッテリーコード/アブソーバー/音響用/ボディ強化等、アイディア次第！<br>
機能：エンジンなど、エイジングが終わり使用を続けて行くうちに始まる劣化、風化、消耗により発生するへたりを和らげ、パーツが持つ本来の機能を復活させる働きがあります。<br>
こちらは、ハーフタイプとなります。通常版の幅が半分になりますので、狭い場所などへの施工可能です。
主成分：ラジウム樹脂を主とした鉱物成分<br>
効果：施工後、すぐに効果を発揮しますが、通常、36時間のエイジングを行うことで100%近くの効果を発揮いたします。<br>
さらに、SP版はGTKIII-STに比べ、ラジウム樹脂量が二倍になっており、さらに大きな効果が期待できます。<br>
施工方法：<br>1)アルコールなどで施工箇所の汚れを拭き取ってください。<br>
2)製品背面のシールをはがし、汚れを拭き取った施工箇所に直接貼り付け、施工は終了です。<br><br>
特典：6枚以上お買い上げで、さ・ら・に+1枚プレゼント中！<br>
製品仕様：製品の性能、デザイン等は予告なく変更することがあります。
<br>
【　ＧＴＫ－ＩＩＩＨＳＰ　は問題ありませんが、ＧＴＫ－ＩＩＩＳＰ　や、ＧＴＫ－h/ＳＰの場合　】<br>
両面テープの外し方ですが、裏紙と、か占めて有る為に、外し方にちょっとコツが必要です。<br>淵から1箇所、センターのボッチ迄、裏紙だけをめくります、センターのボッチ迄、そのボッチの４分の１前後迄、少々破る感じで、ビリッと破きます。<br>その後、その反対側からめくって頂き、引き抜いて頂くと比較的簡単に取れます。コツは、少々引く時に少々左右に振りながら抜くと抜けやすいです。<br>
<br>
